import Header from './Header.js';
import About from './About.js';
import Search from './Search.js';
import SupermarketList from './SupermarketList.js';


function App() {
  return (
    <div>
      <Header/>
      <About/>
      <Search/>
      <SupermarketList/>
    </div>
  );
}

export default App;
